import '../App.css'
import './bios.css'
import testImage from '../assets/DSC09360.png'

type

export default function Bios() {
    const topRow = ['Bridgit',
                   'Gabriella',
                   'Bella',
                   'Andrew']
    const bottomRow = ['Vincent',
                        'Benedict',
                        'Evan',
                        'Hubert']

    return (
        <div className='bio-main'>
            <h1>Meet the Members</h1>
            <div className='bio-row'>{topRow.map((p) => Bio())}</div>
            <div className='bio-row'>{bottomRow.map((p) => Bio())}</div>
        </div>
    )
}

// Individual bio
function Bio() {
    return <div className='bio-single'>
        <img src={testImage} alt='WYS Andrew'/>
    </div>
}


